import React from 'react';
import {Button, Col, DatePicker, Form, Input, Select} from 'antd';
import {countryList} from './countryList';
import {AppRowContainer} from '../../../../@crema';
import IntlMessages from '../../../../@crema/utility/IntlMessages';

const Information = () => {
  const onFinish = (values) => {
    console.log('Success:', values);
  };
  const {Option} = Select;
  console.log(countryList);
  const onFinishFailed = (errorInfo) => {
    console.log('Failed:', errorInfo);
  };
  const {TextArea} = Input;

  return (
    <Form
      className='user-profile-form'
      initialValues={{remember: true}}
      onFinish={onFinish}
      onFinishFailed={onFinishFailed}>
      <h3 className='user-profile-form-title'>
        <IntlMessages id='userProfile.information' />
      </h3>
      <AppRowContainer gutter={16}>
        <Col xs={24} md={24}>
          <Form.Item
            name='bio'
            rules={[{required: true, message: 'Please input your Bio Data'}]}>
            <TextArea rows={4} placeholder='Your Bio data here...' />
          </Form.Item>
        </Col>
        <Col xs={24} md={12}>
          <Form.Item
            name='birthdate'
            rules={[{required: true, message: 'Please input Date!'}]}>
            <DatePicker style={{width: '100%'}} format='DD M YYYY' />
          </Form.Item>
        </Col>
        <Col xs={24} md={12}>
          <Form.Item
            name='country'
            rules={[{required: true, message: 'Please input Your Country!'}]}>
            <Select
              showSearch
              style={{width: '100%'}}
              placeholder='Select a country'
              optionFilterProp='children'
              filterOption={(input, option) =>
                option.children.toLowerCase().indexOf(input.toLowerCase()) >= 0
              }>
              {countryList.map((country, index) => {
                return (
                  <Option key={index} value={country.name}>
                    {country.name}
                  </Option>
                );
              })}
            </Select>
          </Form.Item>
        </Col>

        <Col xs={24} md={12}>
          <Form.Item
            name='website'
            rules={[{required: true, message: 'Please input your Website!'}]}>
            <Input placeholder='Website' />
          </Form.Item>
        </Col>
        <Col xs={24} md={12}>
          <Form.Item
            name='phone'
            rules={[
              {required: true, message: 'Please input your Phone number!'},
            ]}>
            <Input placeholder='Phone Number' />
          </Form.Item>
        </Col>
        <Col xs={24} md={24}>
          <Form.Item shouldUpdate className='user-profile-group-btn'>
            <Button type='primary' htmlType='submit'>
              Save Changes
            </Button>
            <Button htmlType='cancel'>Cancel</Button>
          </Form.Item>
        </Col>
      </AppRowContainer>
    </Form>
  );
};

export default Information;
